import React from 'react';
import axios from 'axios';

axios.defaults.headers.get['Access-Control-Allow-Origin'] = 'http://localhost:5000';

class Unexpanded extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfKills: null
        };
    }
    render() {
        return (
            <div>
                <p className='noPad'>{this.props.name}</p>
                <p>{this.state.numberOfKills}</p>
                <button onClick={this.handleClick}>click me</button>
            </div>
        )
    }
    handleClick = () => {
        axios.get('/api/esi/getNumKills')
            .then(response => {
                return this.setState({numberOfKills: response.data})
            })
    };
};

